issue.body:
Hi, since the next major version of vue lsp include a breaking change the need the client side to forward the request from vue lsp to a typescript lsp. However, when I try with

```lua
        client.handlers['tsserverRequest'] = function(error, result, context, config)
          local ts_client = ergou.lsp.get_clients({ bufnr = context.bufnr, name = 'vtsls' })[1]

          local params = {
            command = 'typescript.tsserverRequest',
            arguments = unpack(result),
          }

          local res = ts_client:request('workspace/executeCommand', params, function(er, re, co, cf)
            dd('error', er or 'no error', 'result', re or 'no result', 'context', co, 'config', cf or 'no config')
          end)

          dd(res)
          return { error = nil }
        end
```

The first request needs to forward is `projectinfo` but It does no seems to get any result back,

here's the printed result:

```
{ "error", "no error", "result", "no result", "context", {
    bufnr = 2,
    client_id = 3,
    method = "workspace/executeCommand",
    params = {
      arguments = { "projectInfo", {
          file = "/home/raydev/test/vue/my-vue-app/src/App.vue",
          needFileNameList = false
        } },
      command = "typescript.tsserverRequest"
    },
    version = 0
  }, "config", "no config" }
```

And from the log 

> 72 ‚îÇ [DEBUG][2025-05-07 22:51:03] ...m/lsp/client.lua:673 "LSP[vtsls]" "client.request" 3 "workspace/executeCommand" { arguments = { "projectInfo", { file = "/home/raydev/test/vue/my-vue-app/src/App.vue", needFileNameList = false } }, comm
‚îÇ and = "request" } <function 1> 2
73 ‚îÇ [DEBUG][2025-05-07 22:51:03] .../vim/lsp/rpc.lua:216 "rpc.send" { id = 3, jsonrpc = "2.0", method = "workspace/executeCommand", params = { arguments = { "projectInfo", { file = "/home/raydev/test/vue/my-vue-app/src/App.vue", needFileNameList
‚îÇ = false } }, command = "request" } }
74 ‚îÇ [DEBUG][2025-05-07 22:51:03] .../vim/lsp/rpc.lua:346 "server_request: callback result" { result = {}, status = true }
75 ‚îÇ [DEBUG][2025-05-07 22:51:03] .../vim/lsp/rpc.lua:216 "rpc.send" { id = 1, jsonrpc = "2.0", result = {} }
76 ‚îÇ [DEBUG][2025-05-07 22:51:03] .../vim/lsp/rpc.lua:330 "rpc.receive" { jsonrpc = "2.0", method = "window/logMessage", params = { message = "Command request not found", type = 1 } }
77 ‚îÇ [DEBUG][2025-05-07 22:51:03] .../vim/lsp/rpc.lua:330 "rpc.receive" { id = 3, jsonrpc = "2.0" }


I see the response sends `{ id = 3, jsonrpc = "2.0" }` which does not include the body.

To give more context the vscode extension has to use a hack to access `tsserver` to execute command: https://github.com/vuejs/language-tools/blob/5d2731321a8efca4e82677f37f6e10139d7e0043/extensions/vscode/src/nodeClientMain.ts#L160-L164, and this is the PR that implemented it in vue lsp: https://github.com/vuejs/language-tools/pull/5252.

Is this the similar thing that it is a known limitation caused by typescript `tsserver`?

Any insight would be helpful, thanks in advance.

